import React from "react";

function Test() {
  state = {
    name: "Ben",
    age: "92",
  };
  return (
    <div>
      <p>This is a Test</p>
      <p>
        Here I want to take an output: {this.name} and {this.state.age}
      </p>
    </div>
  );
}

export default Test;
